import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

class PlaylistButton extends Component {
    constructor() {
        super();
    }
    render () {
        <div>
            <Button variant="primary"></Button>
        </div>
    }
}

export default PlaylistButton
